-1-1024x576.jpg\" alt=\"\" class=\"wp-image-50\"/><figcaption>案例2</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":50} -->\n<div style=\"height:50px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {\"verticalAlignment\":\"top\",\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide are-vertically-aligned-top\"><!-- wp:column {\"verticalAlignment\":\"top\"} -->\n<div class=\"wp-block-column is-vertically-aligned-top\"><!-- wp:heading {\"level\":3} -->\n<h3 id=\"添加区块版面配置\">添加区块版面配置</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>区块版面配置是预先设计的一组区块。要添加一个区块版面配置，请在编辑器顶部的工具栏中选择“添加区块”按钮[+]。切换到搜索栏下方的模式标签，然后选择一种模式。</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"verticalAlignment\":\"top\"} -->\n<div class=\"wp-block-column is-vertically-aligned-top\"><!-- wp:heading {\"level\":3} -->\n<h3 id=\"框住您的图像\">框住您的图像</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>二〇二一包含您内容的时尚边框。选择图像区块后，打开编辑器侧栏中的“样式”面板。选择“框架”区块样式以将其激活。</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"verticalAlignment\":\"top\"} -->\n<div class=\"wp-block-column is-vertically-aligned-top\"><!-- wp:heading {\"level\":3} -->\n<h3 id=\"重叠列\">重叠列</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>二〇二一还包括列区块的重叠样式。选定列区块后，打开编辑器侧栏中的“样式”面板。选择“重叠”区块样式进行尝试。</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', '', '', 'publish', 'closed', 'closed', '', '%e9%a6%96%e9%a1%b5', '', '', '2022-02-18 13:25:01', '2022-02-18 05:25:01', '', 0, 'http://localhost/wordpress/?page_id=12', 0, 'page', '', 0),
