(42, 1, '2022-02-18 11:42:38', '2022-02-18 03:42:38', '<!-- wp:paragraph {\"align\":\"left\",\"fontSize\":\"medium\"} -->\n<p class=\"has-text-align-left has-medium-font-size\">辅助生殖集团创办于2007年，是中国基因助孕的开创者，创办人均为从事多年医学、生物学专业人员，具有本科及博士学历。自07年首次开展助孕，已经让7000多个不育家庭获得了欢乐，改变了数万人的生活，从这个角度来讲,助孕意义非凡。</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"fontSize\":\"medium\"} -->\n<p class=\"has-text-align-left has-medium-font-size\">目前美国，俄罗斯等十几个国家早已将助孕合法化，这给我们最重要的提示是,助孕不是对自然生殖过程的革命,而是帮助不育家庭获得天伦之乐的途径，如果以此为核心标准来行事,则助孕的负面影响将大大减少,对人类的益处将大大增加。&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"fontSize\":\"medium\"} -->\n<p class=\"has-text-align-left has-medium-font-size\">我们多年来致力于为不育人群提供优质的助孕服务，力求帮助您获得一个健康、阳光、聪明的小宝宝。</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"fontSize\":\"medium\"} -->\n<p class=\"has-text-align-left has-medium-font-size\"><strong>本中心于2012年率先开展孕前基因筛查和心理咨询，是中国基因助孕的开创者，成立11年以来，成功率高达80%以上。</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>&nbsp;</li><li><strong>选择的理由</strong></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><li>1.中国基因助孕开创者，首次将孕前基因筛查引入助孕行业。</li><li>2.始创于2007年，已成功帮助7000多不孕不育家庭实现家庭梦想。</li><li>3.创始人毕业于985/211高校医学、生物学专业，具有博士及本科学历。</li><li>4.创始人曾就职于三甲医院，拥有强大的医疗资源。</li><li>5.创始人曾以其他身份接受过中央电视台和新华社的专访。</li><li>6.我们只和世界排名前三的基因公司合作，美国的foundation公司和中国的华大基因。</li><li>7.国内首家引入心理医生团队筛选和考核代妈，确保代妈心理健康。</li><li>8.正规三甲生殖中心高口碑高成功率专家医生全职全程参与。</li><li>9.年轻且有过顺产经验的性格稳定爱心爆棚的健康优质代妈。</li><li>10.业界第一的试管婴儿助孕80%综合成功率。</li><li>11.全过程公开透明无欺诈无陷阱。</li><li>12. 十一年无重大医疗事故，无负面新闻报道和法律纠纷。</li><li>13.优胜劣汰高度净化的高素质员工团队，集团公司化运营和管理。</li><li>14.业界不诚信曝光台网站的发起者，力求通过行业自身净化规避欺诈等不诚信行为。</li><li>15.多次通过不同渠道向卫生等监管部门建议适度放开助孕行业，让助孕阳光化。</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', '', '', 'publish', 'closed', 'closed', '', '%e5%85%b3%e4%ba%8e%e6%88%91%e4%bb%ac', '', '', '2022-02-18 16:40:42', '2022-02-18 08:40:42', '', 0, 'http://localhost/wordpress/?p=42', 0, 'post', '', 0),
