-1-1024x576.jpg\" alt=\"\" class=\"wp-image-50\"/><figcaption>案例2</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":50} -->\n<div style=\"height:50px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {\"verticalAlignment\":\"top\",\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide are-vertically-aligned-top\"><!-- wp:column {\"verticalAlignment\":\"top\"} -->\n<div class=\"wp-block-column is-vertically-aligned-top\"><!-- wp:heading {\"level\":3} -->\n<h3 id=\"添加区块版面配置\">添加区块版面配置</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>区块版面配置是预先设计的一组区块。要添加一个区块版面配置，请在编辑器顶部的工具栏中选择“添加区块”按钮[+]。切换到搜索栏下方的模式标签，然后选择一种模式。</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"verticalAlignment\":\"top\"} -->\n<div class=\"wp-block-column is-vertically-aligned-top\"><!-- wp:heading {\"level\":3} -->\n<h3 id=\"框住您的图像\">框住您的图像</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>二〇二一包含您内容的时尚边框。选择图像区块后，打开编辑器侧栏中的“样式”面板。选择“框架”区块样式以将其激活。</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"verticalAlignment\":\"top\"} -->\n<div class=\"wp-block-column is-vertically-aligned-top\"><!-- wp:heading {\"level\":3} -->\n<h3 id=\"重叠列\">重叠列</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>二〇二一还包括列区块的重叠样式。选定列区块后，打开编辑器侧栏中的“样式”面板。选择“重叠”区块样式进行尝试。</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', '', '', 'inherit', 'closed', 'closed', '', '12-revision-v1', '', '', '2022-02-18 13:25:01', '2022-02-18 05:25:01', '', 12, 'http://localhost/wordpress/?p=72', 0, 'revision', '', 0),
(73, 1, '2022-02-18 13:38:21', '2022-02-18 05:38:21', '<!-- wp:paragraph -->\n<p id=\"block-41369e83-7e64-4b1a-b1d5-97ac33dfac35\"><br>辅助生殖集团创办于2007年，是中国基因助孕的开创者，创办人均为从事多年医学、生物学专业人员，具有本科及博士学历。自07年首次开展助孕，已经让7000多个不育家庭获得了欢乐，改变了数万人的生活，从这个角度来讲,助孕意义非凡。</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"block-1456a137-6840-4d3d-a14c-c2c69d75f2f4\">目前美国，俄罗斯等十几个国家早已将助孕合法化，这给我们最重要的提示是,助孕不是对自然生殖过程的革命,而是帮助不育家庭获得天伦之乐的途径，如果以此为核心标准来行事,则助孕的负面影响将大大减少,对人类的益处将大大增加。&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"block-d0212528-1677-4d89-a982-dbee757adc68\">我们多年来致力于为不育人群提供优质的助孕服务，力求帮助您获得一个健康、阳光、聪明的小宝宝。</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"block-9f9866a0-193e-4e43-a8f4-cff5fc0b85c6\"><strong>本中心于2012年率先开展孕前基因筛查和心理咨询，是中国基因助孕的开创者，成立11年以来，成功率高达80%以上。</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul id=\"block-2c63fafb-c345-44f7-b2ee-d0c838ea8656\"><li>&nbsp;</li><li><strong>选择的理由</strong></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul id=\"block-f0b633eb-21f7-4d04-8194-77ea59152d65\"><li>1.中国基因助孕开创者，首次将孕前基因筛查引入助孕行业。</li><li>2.始创于2007年，已成功帮助7000多不孕不育家庭实现家庭梦想。</li><li>3.创始人毕业于985/211高校医学、生物学专业，具有博士及本科学历。</li><li>4.创始人曾就职于三甲医院，拥有强大的医疗资源。</li><li>5.创始人曾以其他身份接受过中央电视台和新华社的专访。</li><li>6.我们只和世界排名前三的基因公司合作，美国的foundation公司和中国的华大基因。</li><li>7.国内首家引入心理医生团队筛选和考核代妈，确保代妈心理健康。</li><li>8.正规三甲生殖中心高口碑高成功率专家医生全职全程参与。</li><li>9.年轻且有过顺产经验的性格稳定爱心爆棚的健康优质代妈。</li><li>10.业界第一的试管婴儿助孕80%综合成功率。</li><li>11.全过程公开透明无欺诈无陷阱。</li><li>12. 十一年无重大医疗事故，无负面新闻报道和法律纠纷。</li><li>13.优胜劣汰高度净化的高素质员工团队，集团公司化运营和管理。</li><li>14.业界不诚信曝光台网站的发起者，力求通过行业自身净化规避欺诈等不诚信行为。</li><li>15.多次通过不同渠道向卫生等监管部门建议适度放开助孕行业，让助孕阳光化。</li></ul>\n<!-- /wp:list -->', '关于我们', '', 'publish', 'closed', 'closed', '', '73-2', '', '', '2022-02-18 13:39:04', '2022-02-18 05:39:04', '', 0, 'http://localhost/wordpress/?page_id=73', 0, 'page', '', 0),
